stop=stopwords()
def my_tokenizer(s):
    s = s.lower() # downcase
    tokens = nltk.tokenize.word_tokenize(s) # string to tokens
    tokens = [t for t in tokens if len(t) > 2] # remove short words
    tokens = [wordnet_lemmatizer.lemmatize(t) for t in tokens] # put words into base form
    tokens = [t for t in tokens if t not in stop] # remove stopwords
    return tokens
	
def live_token(live):
    live_tok=[]
    for review in live:
        zoken = my_tokenizer(review)
        live_tok.append(zoken)
    return live_tok
	
def tokens_to_vector(tokens, label):
	x = np.zeros(len(word_index_map) + 1)
	for t in tokens:
		i=word_index_map[t]
		x[i] += 1
	x = x / x.sum()
	x[-1] = label
	return x
	
def token_vector():
    i = 0
    for tokens in positive_token:
        xy = tokens_to_vector(tokens, 1)
        data[i, :] = xy  # currrent row all columns
        i += 1

    for tokens in negetive_token:
        xy = tokens_to_vector(tokens, 0)
        data[i, :] = xy
        i += 1
    return data	
	
